import React,{Component} from 'react';
import {Container,Navbar,Nav} from 'react-bootstrap';

class footer extends Component{
    render(){
        return(
            <div className="footer-content">
                <Container>
                    <Navbar>
                        <Nav>
                            <Nav.Link>
                                About
                            </Nav.Link>
                        </Nav>
                    </Navbar>
                    <p>2019 &copy; USU CC reserved.</p>
                </Container>
            </div>            
        )
    }
}
export default footer;
